      console.log("Usu치rio deletado com sucesso");
    } catch (error) {
      console.error("Erro ao deletar usu치rio:", error);
    }
  };

  return (
    <button className="btn-lista-usuarios" onClick={executarDelecaoUsuario}>
      Deletar
